svg.script:

(function() {
  var fullOpacity = 1;
  var halfOpacity = 0.5;
  var flickerDuration = 2000; // 2 seconds of flickering
  var defaultDuration = 5000; // 5 seconds of default colors

  var rects = document.querySelectorAll('#animated-rects rect');
  var originalOpacities = [];
  var isFlickering = false;

  // Store original opacities based on class
  for (var i = 0; i < rects.length; i++) {
    var cls = rects[i].getAttribute('class');
    originalOpacities.push(cls === 'st0' ? fullOpacity : halfOpacity);
  }

  function getRandomOpacity() {
    return Math.random() > 0.5 ? fullOpacity : halfOpacity;
  }

  function getRandomInterval() {
    // Random interval between 50ms and 200ms for realistic modem flicker
    return 50 + Math.floor(Math.random() * 150);
  }

  function startFlickerForRect(rect) {
    function flicker() {
      if (!isFlickering) return; // Stop if flicker phase ended
      rect.style.fillOpacity = getRandomOpacity();
      setTimeout(flicker, getRandomInterval());
    }
    flicker();
  }

  function resetToDefault() {
    for (var i = 0; i < rects.length; i++) {
      rects[i].style.fillOpacity = originalOpacities[i];
    }
  }

  function runAnimation() {
    // Start flicker phase
    isFlickering = true;
    for (var i = 0; i < rects.length; i++) {
      startFlickerForRect(rects[i]);
    }

    // After flicker duration, stop and reset to default
    setTimeout(function() {
      isFlickering = false;
      resetToDefault();

      // After default duration, start again
      setTimeout(runAnimation, defaultDuration);
    }, flickerDuration);
  }

  // Start animation when SVG loads
  // Use setTimeout to ensure DOM is fully ready when embedded via <object>
  function init() {
    if (rects.length > 0) {
      runAnimation();
    } else {
      setTimeout(init, 50);
    }
  }

  if (document.readyState === 'complete' || document.readyState === 'interactive') {
    setTimeout(init, 0);
  } else {
    document.addEventListener('DOMContentLoaded', init);
  }
})();
